        /// <summary>
        /// Sweet heart takes this away!
        /// Basically generating 1 frame
        /// </summary>
        private string GenerateChart(Time time, double widthPx, double heightPx)
        {
            //PART I : declare the components
            string svgHead = null;
            string svgTail = null;
            string planetsLayer = null;
            string houseNumberLayer = null;


            //PART II : fill the components in order
            GenerateComponents();


            //PART III : compile in right placement
            var final =
                $@" <!--MADE BY MACHINES FOR HUMAN EYES-->
                    {svgHead}
                        {StaticBackgroundLayer}
                        {planetsLayer}
                        {houseNumberLayer}
                    {svgTail}
                ";


            return final;




            //------------------------LOCALS NEEDED FOR REFS

            async void GenerateComponents()
            {
                //STEP 0: RESET
                foreach (var zodiac in ZodiacSign.All12ZodiacNames) { ChartOccupiedMarker[zodiac] = 0; }

                //STEP 1: USER INPUT > USABLE DATA
                var svgBackgroundColor = "#f0f2f5"; //not bleach white
                var randomId = Tools.GenerateId();

                planetsLayer = GetPlanetsPositionLayer(time);

                houseNumberLayer = GetHouseNumberLayer(time);

                //note: if width & height not hard set, parent div clips it
                var svgTotalHeight = heightPx;//todo for now hard set, future use: verticalYAxis;
                var svgTotalWidth = widthPx;//todo for now hard set, future use: verticalYAxis;
                var svgStyle = $@"background:{svgBackgroundColor};";//end of style tag
                svgHead = $"<svg viewBox=\"0 0 {svgTotalWidth} {svgTotalHeight}\" width=\"{svgTotalWidth}px\" height=\"{svgTotalHeight}px\" style=\"{svgStyle}\" class=\"SkyChartHolder\" id=\"{randomId}\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\">";//much needed for use tags to work
                //svgHead = $"<svg version=\"1.1\" id=\"_x35_2ea6b1241134b6dac1878118c944582\"\r\n\t xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" x=\"0px\" y=\"0px\" viewBox=\"0 0 1000 1000\"\r\n\t style=\"enable-background:new 0 0 1000 1000;\" xml:space=\"preserve\">";//much needed for use tags to work

                svgTail = "</svg>";

            }

        }

        /// <summary>
        /// Given a time will name all the house boxes
        /// </summary>
        private string GetHouseNumberLayer(Time time)
        {

            var compiled = "";

            foreach (var houseName in House.AllHouses)
            {
                //get 
                ZodiacName houseSignName = ZodiacName.Empty;
                ZodiacSign houseZodiacSign;
                switch (this.ChartType)
                {
                    case ChartType.Rasi:
                        houseZodiacSign = HouseZodiacSign(houseName, time);
                        houseSignName = houseZodiacSign.GetSignName();
                        break;
                    case ChartType.Hora:
                        houseZodiacSign = HouseHoraSign(houseName, time);
                        houseSignName = houseZodiacSign.GetSignName();
                        break;
                    case ChartType.Drekkana:
                        houseZodiacSign = HouseZodiacSign(houseName, time);
                        houseSignName = Calculate.DrekkanaSignName(houseZodiacSign).GetSignName();
                        break;
                    case ChartType.Chaturthamsa:
                        houseZodiacSign = HouseZodiacSign(houseName, time);
                        houseSignName = Calculate.ChaturthamshaSignName(houseZodiacSign).GetSignName();
                        break;
                    case ChartType.Panchamsa:
                        houseZodiacSign = HouseZodiacSign(houseName, time);
                        houseSignName = Calculate.PanchamsaSignName(houseZodiacSign).GetSignName();
                        break;
                    case ChartType.Shashthamsa:
                    case ChartType.Saptamsa:
                    case ChartType.Ashtamsa:
                    case ChartType.Navamsa:
                    case ChartType.Dasamsa:
                    case ChartType.Rudramsa:
                    case ChartType.Dwadasamsa:
                    case ChartType.Shodasamsa:
                    case ChartType.Vimsamsa:
                    case ChartType.Chaturvimsamsa:
                    case ChartType.Nakshatramsa:
                    case ChartType.Trimsamsa:
                    case ChartType.Khavedamsa:
                    case ChartType.Akshavedamsa:
                    case ChartType.Shashthyamsa:
                    default:
                        break;
                }


                var coordinates = GetHousePositionForSignBox(houseSignName);
                var xx = $"<text  transform=\"translate({coordinates.xAxis} {coordinates.yAxis})\"" +
                         $" style=\"fill:#3300FF; font-family:Arial-BoldMT, Arial; font-size:28px; font-weight:700;\">" +
                         $"{(int)houseName}</text>";
                compiled += xx;
            }

            var finalGroup = $@"<g id=""HouseNumberLayer"">{compiled}</g>";

            return finalGroup;
        }

        private string GetPlanetsPositionLayer(Time time)
        {
            var compiled = "";
            Dictionary<PlanetName, ZodiacSign> allPlanetsSigns = new Dictionary<PlanetName, ZodiacSign>();

            switch (this.ChartType)
            {
                case ChartType.Rasi:
                    allPlanetsSigns = Calculate.AllPlanetSigns(time); break;
                case ChartType.Hora:
                    allPlanetsSigns = Calculate.AllPlanetHoraSign(time); break;
                case ChartType.Drekkana:
                    allPlanetsSigns = Calculate.AllPlanetDrekkanaSign(time); break;
                case ChartType.Chaturthamsa:
                    allPlanetsSigns = Calculate.AllPlanetChaturthamsaSign(time); break;
                case ChartType.Panchamsa:
                    allPlanetsSigns = Calculate.AllPlanetPanchamsaSign(time); break;
                case ChartType.Shashthamsa:
                case ChartType.Saptamsa:
                case ChartType.Ashtamsa:
                case ChartType.Navamsa:
                case ChartType.Dasamsa:
                case ChartType.Rudramsa:
                case ChartType.Dwadasamsa:
                case ChartType.Shodasamsa:
                case ChartType.Vimsamsa:
                case ChartType.Chaturvimsamsa:
                case ChartType.Nakshatramsa:
                case ChartType.Trimsamsa:
                case ChartType.Khavedamsa:
                case ChartType.Akshavedamsa:
                case ChartType.Shashthyamsa:
                default:
                    break;
            }

            foreach (var planetSign in allPlanetsSigns)
            {
                var zodiacSign = planetSign.Value;
                var coordinates = GetPlanetPositionForSignBox(zodiacSign.GetSignName());
                var xx = $"<text  transform=\"matrix(1 0 0 1 {coordinates.xAxis} {coordinates.yAxis})\" font-size=\"35\" fill=\"black\">{planetSign.Key}</text>";
                compiled += xx;
            }

            var finalGroup = $@"<g id=""PlanetLayer"">{compiled}</g>";

            return finalGroup;
        }

        /// <summary>
        /// given a house zodiac sign will return x & y where it starts
        /// </summary>
        private static dynamic GetPlanetPositionForSignBox(ZodiacName zodiacName)
        {

            double xAxis = 0;
            double yAxis = 0;

            //check if occupancy number
            var occupancy = ChartOccupiedMarker[zodiacName];
            var jumpCount = occupancy * 45;

            //increment for next check
            ChartOccupiedMarker[zodiacName]++;

            xAxis = ChartPlanetStartCoordinates[zodiacName].xAxis;
            yAxis = ChartPlanetStartCoordinates[zodiacName].yAxis + jumpCount; //if any will go next row

            return new { xAxis = xAxis, yAxis = yAxis };
        }


        /// <summary>
        /// given a house zodiac sign will return x & y where it starts for placing house number
        /// </summary>
        private static dynamic GetHousePositionForSignBox(ZodiacName zodiacName)
        {
            double xAxis = 0;
            double yAxis = 0;

            xAxis = ChartHouseStartCoordinates[zodiacName].xAxis;
            yAxis = ChartHouseStartCoordinates[zodiacName].yAxis;

            return new { xAxis = xAxis, yAxis = yAxis };
        }


